import React, { Component } from 'react'

import ForCastComponent from './ForeCastComponent/ForCastComponent'
class WeatherForeCast extends Component {
  constructor(props) {
    super(props);
    this.state = {
      pastDay:[-7,-5,-5,-4,-3,-2,-1]
    };
  }
  render() {
    console.log(this.state.pastDay[0])
    return (
      <>
        <ForCastComponent pastDay={this.state.pastDay[0]} />
        <ForCastComponent pastDay={this.state.pastDay[1]} />
        <ForCastComponent pastDay={this.state.pastDay[2]} />
        <ForCastComponent pastDay={this.state.pastDay[3]} />
        <ForCastComponent pastDay={this.state.pastDay[4]} />
        <ForCastComponent pastDay={this.state.pastDay[5]} />
        <ForCastComponent pastDay={this.state.pastDay[6]} />
      </>
    );
  }
}

export default WeatherForeCast;
